import React from 'react';
import logo from './logo.svg';
import 'antd/dist/antd.css';
import './App.css';
import { Select } from 'antd';

const { Option } = Select;


function App() {

  function handleChange(value) {
    console.log(`selected ${value}`);
  }

  return (
    <div className="App" style={{paddingTop: 200, paddingLeft:200, paddingRight: 200 }}>
      <header className="App-header">
        <h1>Elenco Campagne</h1>
        <div>
          <br></br>
            <Select style={{ paddingTop: 220}} defaultValue="Campagna 1" style={{ width: 120 }} onChange={handleChange}>
              <Option value="Campagna 1">Campagna 1</Option>
              <Option value="Campagna 2">Campagna 2</Option>
              <Option value="Campagna 3">Campagna 3</Option>
            </Select>
  </div>
      </header>
    </div>
  );
}

export default App;
